import XCTest
@testable import VoiceSnapIT

final class ImageConversionTests: XCTestCase {
    func testItConvertsTheImageCorrectly() {
        let converter = ImageUploader()
        let encodedImage = converter.base64EncodedImage(fromImage: UIImage(named: "Icon-180", in: Bundle(for: type(of: self)), compatibleWith: nil)!)
        XCTAssertEqual(encodedImage, "")
    }
}
